import React, { Component } from 'react'
import {Link} from 'react-router-dom';
export default class CreateLocal extends Component {
    render() {
        return (
            <div>
                <Link className="button is-primary" to="/create-local">Create New Local</Link>
            </div>
        )
    }
}
